import "./Meeting.scss";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import { NavLink, withRouter } from "react-router-dom";
import { connect } from "react-redux";
import React, { useState, useEffect } from "react";
import $ from "jquery";

function Meeting({ text4 = [], displaymode1 }) {
  useEffect(() => {
    $(".navbar").css("position", displaymode1);
  });
  return (
    <>
      <Navbar />
      <div id="up" className="Meeting">
        <div className="gif">
          <img
            className="img1"
            src="https://i.ibb.co/tPBnk9P/qafqaz.gif"
            alt=""
          />
          <img
            className="img2"
            src="https://i.ibb.co/tPBnk9P/qafqaz.gif"
            alt=""
          />
        </div>
        <div className="meetingcontent">
          <div className="meetingtitle"> Tədbirlər </div>
          <div className="meetingdivs">
            {text4.map((tex) => {
              return (
                <>
                  <div className="meetingdiv">
                    {/* <img src={tex.image} alt="" /> */}
                    <div className="alt">
                      {tex.title}
                      <span>Masterclass</span>
                      <div className="time-button">
                        <div className="time">
                          18:00
                          <div className="timetwo">18/12/21</div>
                        </div>
                        {/* <button>Book Now </button> */}
                        <button
                          type="submit"
                          name="subscribe"
                          value="Subscribe"
                          class="btn btn-1"
                        >
                          <svg>
                            <rect
                              x="0"
                              y="0"
                              fill=""
                              width="100%"
                              height="100%"
                            />
                          </svg>
                          <span className="span-text-abune">BOOK NOW</span>
                        </button>
                      </div>
                    </div>
                  </div>
                </>
              );
            })}
          </div>
        </div>
      </div>

      <Footer />
    </>
  );
}

const mapStateToProps = (state, ownProps) => {
  return {
    text4: state.text4,
    displaymode1: state.displaymode1
  };
};

export default connect(mapStateToProps)(Meeting);
